import React, {Component} from 'react';

export default class News extends Component {
    render() {
      return (
        <div className="container">
            <div className="teste-class">
            <h1>
                NOTÍCIAS
            </h1>
            </div>


            <div className="row" id="acontecimentos">
                <div className="col">
                    <h2>Próximos</h2>
                    <div className="row">
                        Linha 1
                    </div>
                    <div className="row">
                        Linha 2
                    </div>
                    <div className="row">
                        Linha 3
                    </div>
                </div>
                <div className="col">
                    <h2>Aconteceu</h2>
                </div>
            </div>
        </div>
      );
    };
  };
